    .then((result) => {
      setUser(result.data);
    })
    .catch((error) => {
      console.log(error);
    })
  }, [])



  return (
    <div>
      <button>버튼</button>
      <h1>리스트</h1>
      {
        console.log(user[0])
      }
      {
        user != null ?
        (
          <div>
            {user[0].id}
            {user[0].name}
          </div>
        ) : 
        (
          <div>실패</div>
        )
      }
    </div>
  )
}

export default App
